import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

const container = {
  height : "200px",
  width : "500px",
  background : "#fff999",
  display : "flex",
  justifyContent : "center",
  alignItems : "center",
  marginTop : "120px",
  flexDirection : "column",
  gap : "20px"
}

const heading = {
  fontSize : "2.2em",
  fontFamily : "'Impact'",
}

const input = {
  fontSize : "20px",
  height : "25px",
  width : "70px"
}

const button = {
  padding : "5px 10px",
  border : "none",
}

const root = document.getElementById('root');
let name = "Earthrelmer";

ReactDOM.render(
  <div style={container}>
  <h1 style={heading}>Helo {name}</h1>
  <input style={input} type="text" />
  <button style={button}>Display</button>
  </div>,
  root
);
